const projectTable = [
    {
        title: 'Job #',
        dataIndex: 'job_number',
        render: (text) => <a href="#">{text}</a>,
    },
    {
        title: 'Project name',
        dataIndex: 'project_name',
    },
    {
        title: 'Created by',
        dataIndex: 'created_by',
    },
    {
        title: 'Created date',
        dataIndex: 'created_at_date',
    },
    {
        title: 'Created time',
        dataIndex: 'created_time',
    },
];

const jobInfoFormTableData = {
    columns: [
        { key: "1", label: "", width: "50%" },
        { key: "2", label: "", width: "50%" },
    ],
    grid: [
        {
          rows: [
            {label: 'Job name', field: 'job_name', required: true},
            {label: 'Job type', field: 'job_type', required: true},
            {label: 'Job id', field: 'job_id', required: true},
            {label: 'AFE #', field: 'afe_num', required: true},
            {label: 'Country', field: 'country', required: true},
            {label: 'Basin', field: 'basin', required: true},
            {label: 'State', field: 'state', required: true},
            {label: 'Start date', field: 'start_date', required: true},
          ]
        }
    ]
}

const padInfoFormTableData = {
    columns: [
        { key: "1", label: "", width: "50%" },
        { key: "2", label: "", width: "50%" },
    ],
    grid: [
        {
          rows: [
            {label: 'Pad name', field: 'pad_name', required: true},
            {label: 'Pad Id', field: 'pad_id', required: true},
            {label: 'Client name', field: 'client_name', required: true},
            {label: 'Customer field rep', field: 'customer_field_rep', required: true},
            {label: 'Rep contact #', field: 'rep_contact_number', required: true},
            {label: 'Operator', field: 'operator', required: true},
            {label: 'Service company', field: 'service_company', required: true},
            {label: 'Wireline company', field: 'wireline_company', required: true},
          ]
        }
    ]
}

const wellInfoFormTableData = {
    columns: [
        { key: "1", label: "Well name", width: "15%", field: "well_name", defaultValue: "Well", required: true },
        { key: "2", label: "Well API", width: "17%", field: "well_api", defaultValue: "", required: true },
        { key: "3", label: "Formation", width: "17%", field: "formation", defaultValue: "", required: true },
        { key: "4", label: "Lat", width: "17%", field: "lat", defaultValue: "", required: true },
        { key: "5", label: "Easting", width: "17%", field: "easting", defaultValue: "", required: true },
        { key: "6", label: "Northing", width: "17%", field: "northing", defaultValue: "", required: true },
    ],
    grid: [
        {
          row: "row1"
        }
    ]
}

const wellVolumeFormTableData = {
    columns: [
        { key: "1", label: "Type", width: "15%", field: "type", required: true },
        { key: "2", label: "OD", width: "17%", field: "od", required: true },
        { key: "2", label: "Wt", width: "17%", field: "wt", required: true },
        { key: "2", label: "ID", width: "17%", field: "id", required: true },
        { key: "2", label: "Depth [MD]", width: "17%", field: "depth_md", required: true },
        { key: "2", label: "TOL", width: "17%", field: "tol", required: true },
    ],
    grid: [
        {
          rows: [
            'Casing',
            'Liner #1',
            'Liner #2'
          ]
        }
    ]
}

const wellVolumeEstimationsFormTableData = {
    columns: function (wellName) {
        return [
            { key: "1", label: wellName, colSpan: "2" },
        ]
    },
    grid: [
        {
          rows: [
            {label: 'Surface Vol. [bbls]', field: 'surface_vol'},
            {label: 'bbls', field: 'bbls'},
            {label: 'gallons', field: 'gallons'},
          ]
        }
    ]
}

const clientInfoFormTableData = {
    columns: [
        { key: "1", label: "Client Username", width: "40%", field: "clientusername", required: true },
        { key: "2", label: "Title", width: "30%", field: "title", required: true },
        { key: "2", label: "Password", width: "30%", field: "password", required: true },
    ],
    grid: [
        {
          rows: [
            ''
          ]
        }
    ]
}

const crewInfoFormTableData = {
    columns: [
        { key: "1", label: "Role", width: "40%", field: "role" },
        { key: "2", label: "Name", width: "30%", field: "name" },
        { key: "2", label: "Contact", width: "30%", field: "contact" },
    ],
    grid: [
        {
          rows: [
            {label: 'Engineering manager'},
            {label: 'Field engineer'},
            {label: 'Field engineer'},
            {label: 'Field engineer'},
          ]
        }
    ]
}

const equipmentFormTableData = {
    columns: [
        { key: "1", label: "Equipment", width: "50%" },
        { key: "1", label: "ID #", width: "50%" },
    ],
    grid: [
        {
          rows: [
            {label: 'Trailers', field: 'trailers'},
            {label: 'Powerpack', field: 'powerpack'},
            {label: 'Source', field: 'source'},
            {label: 'Accumulator', field: 'accumulator'},
            {label: 'Hydrophones', field: 'hydrophones'},
            {label: 'PSI transducer', field: 'psi_transducer'},
            {label: 'Hotspot', field: 'hotspot'},
          ]
        }
    ]
}

const TableHeadersUtil = {
    clientInfoFormTableData,
    crewInfoFormTableData,
    jobInfoFormTableData,
    padInfoFormTableData,
    projectTable,
    wellInfoFormTableData,
    wellVolumeFormTableData,
    wellVolumeEstimationsFormTableData,
    equipmentFormTableData
}

export default TableHeadersUtil;
